var scripts=[];function loadJS(FILE_URL,async=true){let scriptEle=document.createElement("script");scriptEle.setAttribute("src",FILE_URL);scriptEle.setAttribute("type","text/javascript");scriptEle.setAttribute("async",async);document.body.appendChild(scriptEle);scriptEle.addEventListener("load",()=>{console.log("File loaded")});scriptEle.addEventListener("error",ev=>{console.log("Error on loading file",ev)})}$("input[data-smart-validator]").each(function(i,e){var func=window[$(this).data("smart-validator")];console.log("Found validator for Field:",$(e).attr("name"));$(e).on("blur",function(){$(this).parent().find("ul.errorlist").remove();var ret=func($(this).val());if(typeof ret==="string"){$(this).parent().find("span.errors").html("<ul class='errorlist'><li>"+gettext(ret)+"</li></ul>")}})});$(".formset[data-smart-validator]").each(function(i,e){console.log("Found validator for FormSet:",e)});$("form[data-smart-validator]").each(function(i,e){console.log("Found validator for Field:",$(e).attr("id"))});$(".module[data-smart-validator]").each(function(i,e){console.log("Found validator for Module:",e)});
